package main.java.career.softserveinc.com.softserve.model.task8;

import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.ValueSource;
import java.io.IOException;
import java.math.BigInteger;
import java.util.ArrayList;
import java.util.List;

import static org.junit.jupiter.api.Assertions.*;

class FibonacciManagerTest {

    @ParameterizedTest
    @ValueSource(strings = {" " +
            " " +
            " " +
            " " +
            " " +
            "",
            "100 200 144",
            "200 10 13 21 34 55 89 144",
            "13 21",
            "44 100 55 89"})

    void getSubsequenceParametrizedTestWithGivenBorders(String string) throws IOException {
        String[] splintedParams = string.split(" ");
        BigInteger start = new BigInteger(splintedParams[0]);
        BigInteger end = new BigInteger(splintedParams[1]);
        List<BigInteger> actual = FibonacciManager.findSubSequence(start, end);
        List<BigInteger> expected = new ArrayList<>();
        for (int i = 0; i < splintedParams.length-2; i++) {
            expected.add(new BigInteger(splintedParams[i+2]));
        }
        System.out.println(expected);
        System.out.println(actual);
        assertArrayEquals(expected.toArray(), actual.toArray());
    }


    @ParameterizedTest
    @ValueSource(strings = {"5, 10946, 17711, 28657, 46368, 75025",
            "100, 1344719667586153181419716641724567886890850696275767987106294472017884974410332069524504824747437757, 2175802127494856116713672426425688880595219724476419600966267302098624954951397614199316858899137282, 3520521795081009298133389068150256767486070420752187588072561774116509929361729683723821683646575039, 5696323922575865414847061494575945648081290145228607189038829076215134884313127297923138542545712321, 9216845717656874712980450562726202415567360565980794777111390850331644813674856981646960226192287360",
            "777, , , , , ",
            "2, 13, 21, 34, 55, 89",
            "10000, , , , , "})
    void getSubsequenceParametrizedTestWithGivenLengthOfNumbers(String string) throws IOException {
        String[] splintedParams = string.split(", ");
        int length = Integer.parseInt(splintedParams[0]);
        List<BigInteger> actual = FibonacciManager.findSubSequence(length);
        List<BigInteger> expected = new ArrayList<>();
        for (int i = 0; i < splintedParams.length-1; i++) {
            expected.add(new BigInteger(splintedParams[i+1]));
        }
        assertArrayEquals(expected.toArray(), actual.toArray());
    }

}